import './index.css';
import { Route, Routes } from 'react-router-dom';
import React from 'react';

const Auth = React.lazy(() => import(/* webpackChunkName: 'Auth' */ './Pages/Auth'));

const App: React.FC = () =>  {
  return (
    <Routes>
        <Route path='/' element={<Auth/>}/>
    </Routes>
  );
}

export default App;
